    "FEMA Framework Basemap datasets comprise six of the seven FGDC themes of geospatial
    data that are used by most GIS applications (Note: the seventh framework theme,
    orthographic imagery, is packaged in a separate NFIP Metadata Profile): cadastral,
    geodetic control, governmental unit, transportation, general structures, hydrography
